import React from 'react';
import './Drawing.scss';

class Drawing extends React.Component {

  render() {    
    return (
      <div className="drawing">
        <h1>WebSite B Theories</h1>
        <p>Here you will find pages about little known phenomenons I've collected over the years.</p>
        <p>You won't find these on Google, Wiki, or Reddit!</p>
        <marquee>Read at <b>your</b> own <u>risk</u>!!</marquee>
        <p>
            <a href="">The Woman With The Long Arms</a>
        </p>
        <p>
            <a href="">Lorem Ipsum</a>
        </p>
      </div>
    );
  }
}

export default Drawing;
